def count_smaller_elements_to_right(arr, n):
    count = [-1] * n
    stack = []
    for i in range(n - 1, -1, -1):
        while stack and arr[i] <= stack[-1][0]:
            stack.pop()
        if stack:
            count[i] = stack[-1][1]
        stack.append((arr[i], i))
    return count

