    count = count_smaller_elements_to_right(arr, len(arr))
    nearest_greater = [-1] * len(arr)
    stack = []
    for i in range(len(arr) - 1, -1, -1):
        while stack and stack[-1] <= arr2[count[i]]:
            stack.pop()
        if stack:
            nearest_greater[i] = stack[-1]
        stack.append(arr2[i])
    return nearest_greater

