    """
    Parameters:
    A (int): Number of pens in the first pile.
    B (int): Number of pens in the second pile.

    Returns:
    int: Minimum number of pens to be added to the third pile.
    """
    K = 1
    while True:
        total_pens = A + B + K
        if is_prime(total_pens) or total_pens == 1:
            return K
        K += 1

