    modified_arr.sort()
    count = 0
    fenwick_tree = [0] * (n + 1)

    def update(index, value):
        while index <= n:
            fenwick_tree[index] += value
            index += index & -index

    def query(index):
        result = 0
        while index > 0:
            result += fenwick_tree[index]
            index -= index & -index
        return result
    for value, i in modified_arr:
        count += query(i)
        update(i + 1, 1)
    return count

