    def merge_sort_and_count(arr):
        if len(arr) <= 1:
            return (0, arr)
        mid = len(arr) // 2
        left_count, left_sorted = merge_sort_and_count(arr[:mid])
        right_count, right_sorted = merge_sort_and_count(arr[mid:])
        cross_count, merged = merge_and_count(left_sorted, right_sorted)
        total_count = left_count + right_count + cross_count
        return (total_count, merged)

    def merge_and_count(left, right):
        merged = []
        i = j = 0
        cross_count = 0
        while i < len(left) and j < len(right):
            if left[i][0] <= right[j][0]:
                merged.append(left[i])
                i += 1
            else:
                cross_count += len(left) - i
                merged.append(right[j])
                j += 1
        merged.extend(left[i:])
        merged.extend(right[j:])
        return (cross_count, merged)
    _, result = merge_sort_and_count(transformed)
    return result

