class SegmentTree:

    def __init__(self, n):
        self.n = n
        self.tree = [0] * (2 * n)

    def update(self, idx, val):
        idx += self.n
        self.tree[idx] += val
        while idx > 1:
            idx >>= 1
            self.tree[idx] = self.tree[2 * idx] + self.tree[2 * idx + 1]

    def query(self, ql, qr):
        res = 0
        ql += self.n
        qr += self.n
        while ql < qr:
            if ql & 1:
                res += self.tree[ql]
                ql += 1
            if qr & 1:
                qr -= 1
                res += self.tree[qr]
            ql >>= 1
            qr >>= 1
        return res

def countPairs(A: List[int], N: int) -> int:
    B = [(i * x, i) for i, x in enumerate(A)]
    B.sort()
    st = SegmentTree(N)
    index_map = {}
    for value, index in B:
        if value not in index_map:
            index_map[value] = []
        index_map[value].append(index)
    ans = 0
    for value, index in B:
        for i in index_map[value]:
            cnt = st.query(i + 1, N - 1)
            ans += cnt
        for i in index_map[value]:
            st.update(i, 1)
    return ans

