class Solution:

    def printUniqueSubset(self, nums, n=None):
        if n is None:
            n = len(nums)
        if n == 0:
            return [[]]
        unique_subsets = self.printUniqueSubset(nums, n - 1)
        current_value = nums[n - 1]
        for subset in unique_subsets[:]:
            if -current_value not in nums:
                subset.append(current_value)
        return unique_subsets + [subset for subset in unique_subsets if current_value in subset]
