class Solution:

    def printUniqueSubset(self, nums):
        nums.sort()
        result = set()

        def backtrack(start, path):
            result.add(tuple(path))
            for i in range(start, len(nums)):
                if i > start and nums[i] == nums[i - 1]:
                    continue
                path.append(nums[i])
                backtrack(i + 1, path)
                path.pop()
        backtrack(0, [])
        return [list(subset) for subset in result]

